import ActionTypes from './type';

const initialState = {
    loginedUser: null,
    users: []
}

function reducer(state = initialState, action: ActionTypes) {

    switch (action.type) {

        case "SUCCESS_LOGIN":
            return {
                loginedUser: action.payload
            }

        case 'SET_USERS':
            alert()
            return action.payload
        default:
            return state
    }

}

export default reducer
